// Custom base64 decoder implementation
const base64Chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/';

function customAtob(base64String) {
    // Remove padding and whitespace
    base64String = base64String.replace(/=+$/, '').replace(/\s/g, '');
    
    const binaryString = [];
    let bits = 0;
    let buffer = 0;
    
    for (let i = 0; i < base64String.length; i++) {
        const value = base64Chars.indexOf(base64String[i]);
        if (value === -1) {
            throw new Error('Invalid base64 character');
        }
        
        buffer = (buffer << 6) | value;
        bits += 6;
        
        if (bits >= 8) {
            bits -= 8;
            binaryString.push((buffer >> bits) & 0xFF);
        }
    }
    
    return String.fromCharCode(...binaryString);
}

// Modified base64ToUint8Array function using custom decoder
function base64ToUint8Array(base64) {
    const binaryString = customAtob(base64);
    const length = binaryString.length;
    const bytes = new Uint8Array(length);
    for (let i = 0; i < length; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes;
}

// Auto-generated WebAssembly wrapper for cultivation system
const base64Wasm = "";
//cultivation-compiled.js

export const cultivationSystem = {
    instance: null,
    
    async initialize() {
        try {
            const wasmBytes = base64ToUint8Array(base64Wasm);
            const wasmModule = new WebAssembly.Module(wasmBytes);
            
            const importObject = {
                env: {
                    memory: new WebAssembly.Memory({ initial: 256 }),
                    abort: () => console.error('Abort called from WASM')
                }
            };
            
            this.instance = await WebAssembly.instantiate(wasmModule, importObject);
            return this;
        } catch (error) {
            console.error('Failed to initialize WASM module:', error);
            throw error;
        }
    },
    getCurrentStageName(power) {
        return this.instance.exports._getCurrentStageName(power);
    },
    getProgressToNextStage(power) {
        return this.instance.exports._getProgressToNextStage(power);
    },
    addPower(currentPower, amount, isEnlightened) {
        const newPower = this.instance.exports._addPower(currentPower, amount, isEnlightened);
        const oldStageName = this.getCurrentStageName(currentPower);
        const newStageName = this.getCurrentStageName(newPower);
        
        return {
            powerGain: amount,
            newPower: newPower,
            stageChanged: oldStageName !== newStageName,
            newStage: newStageName,
            wasEnlightened: isEnlightened,
            progressGained: this.getProgressToNextStage(newPower)
        };
    },
    checkEnlightenment() {
        return this.instance.exports._checkEnlightenment();
    },
    isInQiCondensation(power) {
        return this.instance.exports._isInQiCondensation(power);
    }
};